import React from 'react';
import {Grid, Divider, Typography, ListItemIcon} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import MailIcon from '@material-ui/icons/Mail';
import InboxIcon from '@material-ui/icons/Mail';

import BeachAccessIcon from '@material-ui/icons/BeachAccess';
import nikklaus from './nikklaus.jpg'
import { red } from '@material-ui/core/colors';
const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      maxWidth: 360,
      backgroundColor: '#fcfcfc',
    },
    avatarst:{
        width: 250,
        height: 250,
        marginLeft: '15px',
        marginTop: '20px'
    }
  }));

  
const Profile = () => {

    const classes = useStyles();
    return ( 
      <Grid container direction="coloumn">
          <Grid item sm={3}>
          <List className={classes.root}>
      <ListItem>
        <Avatar className={classes.avatarst}  alt="Remy Sharp" src={nikklaus}/>
      </ListItem>
      <Typography className={classes.avatarst} variant="h3"  style={{color:'#6042f5' , marginLeft:'40px'}}>
          Klaus Mikaelson
          <Divider/>
          <List style={{fontStyle:'500px'}}>
        {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List> 
      </Typography>
     <Divider/>
     Helo
    </List>
          </Grid>
          <Grid item>
              Heloolloaoa
          </Grid>
      </Grid>
    );
}
 
export default Profile;
